// import * as React from 'react';
import { Link } from 'react-router-dom';
import React, { useEffect, useState } from 'react'
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Paper from '@mui/material/Paper';
import { Header } from "../module/index";
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import {Validation} from "../components/index";
import { Password } from '@mui/icons-material';
import { useLocation, useNavigate } from "react-router";


const Signup=()=>{

  // useEffect(()=>{
  //   if(localStorage.getItem('Email', 'Password')){
  //     Navigate.push('./dashboard')
  //   }
  // })

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");


  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name, email, password);
    const details = {name:name, email:email, password:password}

    let storedDetails = localStorage.getItem('userDetails');
    if(storedDetails==null){
      storedDetails=[]
      storedDetails.push(details);
      localStorage.setItem('userDetails',JSON.stringify(storedDetails))
    }else{
      let newDetail = JSON.parse(storedDetails)
      newDetail.push(details)
      localStorage.setItem("userDetails",JSON.stringify(newDetail))
      const token = "jwt"
      localStorage.setItem("userToken",token);
      const message = "Registered Successfully"
      navigator('/loginup',{state:message})
    };

    }


    const handleClose=()=>{
      setName('');
      setEmail('');
      setPassword('')
  }



  const paperStyle={padding: "10px 20px", width:350, margin:"0px auto"}
  return (
 <>
   <form  onSubmit={handleSubmit}>
 <Header/>

<Paper elevation={20} style={paperStyle} >
{/* {" "}
          {loginup ? ( */}

      <Container component="main" maxWidth="xs" onSubmit={handleSubmit}>

        <Box
          sx={{
            marginTop: 0,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >

          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>

          </Avatar>
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" noValidate sx={{ mt: 1 }}>
          <TextField sx={{backgroundColor: 'lightgrey'}}
              margin="normal"
              required
              fullWidth
              id="name"
              label="Name"
              name="name"
              value="Name"
              onChange={e => setName(e.target.value)}
              autoComplete="name"
              autoFocus
            />
               {/* {errors.name && <p className="error">{errors.name}</p>} */}

            <TextField sx={{backgroundColor: 'lightgrey'}}
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              value="Email"
              onChange={e => setEmail(e.target.value)}
              autoComplete="email"
              autoFocus
            />
            {/* {errors.email && <p className="error">{errors.email}</p>} */}

            <TextField sx={{backgroundColor: 'lightgrey'}}


              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              value="Password"
              onChange={e => setPassword(e.target.value)}


              autoComplete="current-password"
            />
               {/* {errors.password && <p className="error">{errors.password}</p>} */}

            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
          <Link to="/loginup">Login</Link>
            <Button
              type="submit"

              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >

              Sign Up
            </Button>





            {/* <Grid container>
              <Grid item xs>
                <Link href="#" variant="body2">
                  Forgot password?
                </Link>
              </Grid>

              <Grid item>
                <Link href="#" variant="body2">
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid> */}
          </Box>
        </Box>
        {/* <Copyright sx={{ mt: 8, mb: 4 }} /> */}


      </Container>
        {/* )} */}
      </Paper>
</form>

</>


  );

}

export default Signup;
